The parsing rule for msg CommonBaseEvent property in the Windows event logs adapter files truncates the message at the first semi-colon found.  Sometimes the Message value in the event log record contains one or more semi-colons.  Each property in the event log record is terminated by a semi-colon but the rule for msg does not account for the case where the Message value contains semi-colons and parses the end of the msg value at the first semi-colon encountered.

For example, here is a sample Windows application event log record where the Message contains semi-colons:

RecordNumber: 1358;	Severity: 20;	CreationTime: 10/05/2006 21:56:37.000000;	SourceComponent: SCM Client;	EventCategory: 0;	EventID: 00000000;	Username: N/A;	Computername: RNSX641;	LocationType: Hostname;	Message: SCM Client Thu Oct 05 21:56:37 2006 g:\scm5102\src\hc\install\winservice\service.c Line: 953, startServiceApp, HCVCA1018I Process started for C:\PROGRA~1\IBM\SCM\client\..\_jvm\bin\java.exe -classpath ..\jars\client.jar;..\jars\clientPII.jar;..\jars\ITLMToolkit.jar -Djlog.logCmdPort=1953 -Xmx64m -Djava.compiler=NONE  com/ibm/test/client/TestClient   ;

