I took a look at this bug (for the LOCAL connection scenario)

I put the rename code into a separate WorkspaceJob, added the corresponding ISystemArchiveHandler APIs, and was able to pass an archive progress object (a new class) into the archive operations.

Thing worked fine if I don't do any operations in the SystemView while my renaming job is running.  As soon as I tried to expand a folder (a totally different folder), the archive renaming operation failed.

I did some debugging, and found out the following is the reason:

The zip file needs to be opened when doing the renaming operation.  So if any operation close the zip file, an exception will be thrown, and the rename processing will be terminated.
When I tried to click on other object in the system view, we need to update the properties sheet for the currently selected object, which is the virtual file being renamed.  This is the callstack (compressSize is one of the properties displayed for a virtual file).

