And the SystemZipHandler.getCompressedSizeFor() method will actually close->open the zip file to get the compress size property of the virtual entry.

The reason that the zip file need to be opened anytime its properties sheet needs to be displayed is that VirtualChild only cache the following properties:

	public String fullName;
	public String name;
	public String path;
	public boolean isDirectory;
	protected ISystemArchiveHandler _handler;
	protected File _extractedFile;
	protected File _containingArchive;

The followings are its other properties which also displayed in the properties sheet, but the getter function of it needs to query it on the zip file everything the getter function is called:

comment
compressedSize
CompressionMethod
timeStamp

I discussed with Dave, and we both agreed that all virtual file properties need to be cached, and used for display.

So I propose to add the correpsonding properties into the VirtualChild class, and we populate all those needed properties in the implementation of fillBranch() method of the archive handler, since this method already has the access of a ZipEntry, and we should be able to get all those properties once.  Right now, this is the fillBranch() method of SystemZipHandler:

	/**
	 * Populates an entire branch of the tree that comprises the
	 * virtual file system. The parameter is the leaf node, and from
	 * the virtual path of the parameter, we can deduce what the ancestors
	 * of the leaves are, and populate the tree from there.
	 * @param next The ZipEntry from which the branch will be built.
	 */
	protected void fillBranch(ZipEntry next)
	{
		VirtualChild nextChild;
		if (next.getName().equals("/")) return; // dummy entry //$NON-NLS-1$
		if (!next.isDirectory())
		{
			SystemUniversalZipEntry nextEntry = new SystemUniversalZipEntry(next);
			nextChild = new VirtualChild(this, nextEntry.getFullName());
		}
		else // it is a directory
		{
			SystemUniversalZipEntry nextEntry = new SystemUniversalZipEntry(next);
			nextChild = new VirtualChild(this, nextEntry.getFullName());
			nextChild.isDirectory = true;

			if (!_virtualFS.containsKey(nextChild.fullName))
			{
				_virtualFS.put(nextChild.fullName, new HashMap());
			}

		}
		//	key has not been encountered before, create a new 
		// element in the virtualFS.
		if (!_virtualFS.containsKey(nextChild.path))
		{
			recursivePopulate(nextChild.path, nextChild);
		}
		else // key has been encountered before, no need to recursively
			 // populate the subdirectories
		{
			HashMap hm = (HashMap) _virtualFS.get(nextChild.path);
			hm.put(nextChild.name, nextChild);
		}		
	}

But we need to make sure if any operation causes the change of zip file structure or zip file entries, those properties needs to be updated.

And the code for tar file processing is different from zip file processing, and we need to make sure corresponding changes made.

The following code doesn't compile and the error is:
Type mismatch: cannot convert from capture-of ? to Number

class A<T> {
    <S> S test(A<S> a) {
        return null;
    }

    void m() {
        A<?> a = null;
        Number b = test(a);
    }
}

This suggest that Eclipse compiler incorrectly infers S to be ?. This is also shown in the popup window when the mouse pointer is moved to the "test(a)" call. The popup window reads: <?> ? A.test(A<?> a) (note: to get this popup window replace Number with Object so the code compiles and popup window shows the inference, otherwise it shows the compile error). 
As JLS says, and some have already discussed in other bugs, type variable cannot be inferred to be a wildcard.
I would say that in his case there are no constraints for S, and it should be inferred to be Object.
